import Expenses from "./components/Expenses";


function App() {
  const items = [
    { title: 'Car Insurance', amount: 294.67, date: new Date(2021, 2, 21) },
    { title: 'Tooth Brush', amount: 294.67, date: new Date(2021, 2, 21) },
    { title: 'Notes', amount: 294.67, date: new Date(2021, 2, 21) },
  ];
  return (
    <div>
      <Expenses title={items.title} amount={items.amount} date={items.date} />
    </div>
  );
}

export default App;
